import React from 'react'
import {useParams} from 'react-router-dom'

function Info() {
  let params = useParams();
  let login = params.login;

  console.log(getUserInfo(login));

  return (
    <div className='container mt-5'>
      <h1>User Info</h1>
      <hr />
      <p><span className='fw-bold'>ID : </span></p>
      <p><span className='fw-bold'>Login : </span></p>
      <p><span className='fw-bold'>Type : </span></p>
      <p><span className='fw-bold'>Name : </span></p>
      <p><span className='fw-bold'>Location : </span></p>
      <p><span className='fw-bold'>Email : </span></p>
      <p><span className='fw-bold'>Followers : </span></p>
      <p><span className='fw-bold'>Following : </span></p>
    </div>
  )
}

export default Info
